import React from 'react'
import './Header.css'

function Header() {
  return (
    <div>
        <nav className='navbar'>
            <div className='reactMeals'>ReactMeals</div>
            <div className='cart'> Your Cart 0 </div>
        </nav>
    </div>
  )
}

export default Header
